message:
Add setProgressAndMax

This allows you to set the progress and max values in one method call
rather than setting them independently. This removes the need for this
awkward workaround when recycling views with different max values:

```java
// Reset progress so the new max isn't lower than the previous progress.
mProgressButton.setProgress(0);
mProgressButton.setMax(max);
mProgressButton.setProgress(progress);
```

Per discussion in #30.
